INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アヤネ", 2, 401, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301, "2020/07/31 12:00:00", 24001, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アヤネ", 2, 402, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301, "2020/07/31 12:00:00", 24002, 0.0, 2.21, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アヤネ", 2, 403, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301, "2020/07/31 12:00:00", 24003, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アサヒ", 1, 701, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201, "2020/07/31 12:00:00", 24004, 0.0, 1.99, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アサヒ", 2, 702, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201, "2020/07/31 12:00:00", 24005, 0.0, 2.21, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アサヒ", 1, 703, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201, "2020/07/31 12:00:00", 24006, 0.0, 3.33, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "部員３", 2, 801, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301, "2020/07/31 12:00:00", 24007, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "部員３", 2, 802, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301, "2020/07/31 12:00:00", 24008, 0.0, 2.68, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "部員３", 2, 803, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301, "2020/07/31 12:00:00", 24009, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "", 1, 501, 1, "やった！", 192501, "2020/07/31 12:00:00", 24010, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "", 1, 502, 1, "勝ったよ！", 192501, "2020/07/31 12:00:00", 24011, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "", 1, 503, 1, "いい調子！", 192501, "2020/07/31 12:00:00", 24012, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ミサト", 2, 111, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501, "2020/07/31 12:00:00", 24013, 0.0, 5.33, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ミサト", 2, 112, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501, "2020/07/31 12:00:00", 24014, 0.0, 6.85, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ミサト", 2, 113, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501, "2020/07/31 12:00:00", 24015, 0.0, 3.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ダイチ", 2, 611, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401, "2020/07/31 12:00:00", 24016, 0.0, 6.11, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ダイチ", 2, 612, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401, "2020/07/31 12:00:00", 24017, 0.0, 6.75, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ダイチ", 2, 613, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401, "2020/07/31 12:00:00", 24018, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ハツネ", 1, 211, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401, "2020/07/31 12:00:00", 24019, 0.0, 4.52, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ハツネ", 1, 212, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401, "2020/07/31 12:00:00", 24020, 0.0, 3.89, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "ハツネ", 2, 213, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401, "2020/07/31 12:00:00", 24021, 0.0, 13.49, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "カヤ", 2, 311, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501, "2020/07/31 12:00:00", 24022, 0.0, 3.17, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "カヤ", 2, 312, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501, "2020/07/31 12:00:00", 24023, 0.0, 4.42, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "カヤ", 1, 313, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501, "2020/07/31 12:00:00", 24024, 0.0, 2.89, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アヤネ", 3, 421, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301, "2020/07/31 12:00:00", 24025, 0.0, 3.71, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "アサヒ", 1, 721, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201, "2020/07/31 12:00:00", 24026, 0.0, 5.1, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "部員３", 3, 821, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301, "2020/07/31 12:00:00", 24027, 0.0, 4.34, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, 0.0, "", 1, 521, 1, "いい勝負だったよ\nまたやろうね", 192501, "2020/07/31 12:00:00", 24028, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, -360.0, "ミサト", 2, 101, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501, "2020/07/31 12:00:00", 24029, 0.0, 5.62, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, -360.0, "ミサト", 2, 102, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501, "2020/07/31 12:00:00", 24030, 0.0, 9.58, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, -360.0, "ミサト", 2, 103, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501, "2020/07/31 12:00:00", 24031, 0.0, 0.0, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, -360.0, "ミサト", 1, 104, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501, "2020/07/31 12:00:00", 24032, 0.0, 9.13, 10046, "2030/12/17 14:59:59");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (24, -360.0, "ミサト", 2, 105, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501, "2020/07/31 12:00:00", 24033, 0.0, 8.27, 10046, "2030/12/17 14:59:59");
